#!/bin/bash

usage="$(basename "$0") [-h] [--host API host] --  Create test data for tageler

where:
    -h , --help         show this help text
    --host              Set API Host, defaults to http://localhost:8888"

API_HOST='http://localhost:8888'

while [ "$1" != "" ]; do
    case $1 in
        --host )      shift
                                API_HOST=$1
                                ;;
        -h | --help )           echo "$usage"
                                exit
                                ;;
        * )                     echo "$usage"
                                exit 1
    esac
    shift
done

RED='\033[0;31m'
GREEN='\033[0;32m'
NC='\033[0m' # reset color
